import { useState } from 'react';

const Profile = () => {
  const [skills, setSkills] = useState(['React', 'Node.js']);
  const [newSkill, setNewSkill] = useState('');

  return (
    <div className="min-h-screen bg-gray-50 p-10">
      <div className="max-w-4xl mx-auto bg-white rounded-2xl shadow-xl p-10">
        <div className="flex items-center gap-8 mb-10">
          <img src="/api/placeholder/150/150" className="w-32 h-32 rounded-full" alt="avatar" />
          <div>
            <h1 className="text-4xl font-bold">{localStorage.getItem('userName')}</h1>
            <p className="text-xl text-gray-600">Full-Stack Developer</p>
          </div>
        </div>

        <div>
          <h2 className="text-2xl font-bold mb-4">Skills</h2>
          <div className="flex flex-wrap gap-3">
            {skills.map(s => (
              <span key={s} className="px-4 py-2 bg-blue-100 text-blue-800 rounded-full">{s}</span>
            ))}
            <input
              value={newSkill}
              onChange={e => setNewSkill(e.target.value)}
              onKeyPress={e => e.key === 'Enter' && setSkills([...skills, newSkill]) && setNewSkill('')}
              placeholder="+ Add skill"
              className="px-4 py-2 border rounded-full"
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
